calculates.calculation:
(function() {
  var bDay = data('birth_date');  
  var idNum = data('id_number');
  var gender = data('gender');
  var bPlace = data('birth_place');

  if (idNum.length < 5) {
    console.log("The id number is less than 5 characters.  Cannot calculate rc id correctly!")
  }

  var rcId = idNum.charAt(0) + idNum.charAt(2) + idNum.charAt(4);

  // 2 digit month
  var month = parseInt(bDay.getMonth()) + 1; 
  var monthStr = month < 10 ? '0' + month : '' + month;
  rcId += monthStr;

  // 2 digit year
  var year = String(bDay.getFullYear());
  var yearStr = year.slice(2);
  rcId += yearStr;

  // 2 digit date
  var date = parseInt(bDay.getDate());
  var dateStr = date < 10 ? '0' + date : '' + date;
  rcId += dateStr;

  // 1 digit gender
  var genStr = gender === 'female' ? '0' : '1';
  rcId += genStr;

  // 1 char birthplace
  rcId += bPlace.slice(0, 1).toUpperCase();
  return rcId;
})()

